Earn the "House of Daggers" skin by reaching Tier 48 in the Gold Tier of the Pass Royale. It gives your towers a fresh new appearance.

4. Cool Actions and Pictures

There are six new actions called emotes, and they\'re all inspired by the new Dagger Dutchess and its upgrades. If you have Diamond Pass Royale, you get 2 special pictures called Banners. There are 8 more in the Banner Box. Plus, you can earn 2 Banners for free through Community Challenges.

5. Rewards, Boosts, and Deals

You can use tokens to get rewards at the Season Shop. You can buy cards like the Barbarian Barrel, Battle Ram, Princess, and Prince. There\'s also a chance to get cool banners and emotes. For fans of upgrading cards, you can collect Ice Spirit Shards from the Season Shop. Some cards like the Barbarian Barrel, Battle Ram, Princess, and Prince get extra strong this season.

And for the first time ever, there\'s a special offer to buy The Cannoneer, a Tower Troop. It\'s a good deal, especially if you think more Tower Troops might come later.

With these new additions, Clash Royale Season 58 promises to be a lot of fun for players everywhere. Jump in and enjoy all the cool stuff in the Dagger Dutchess update!',
